import barba from '@barba/core';

const transition = (OgComponent) => {
  return () => (
    <div data-barba="container">
      <OgComponent />
    </div>
  );
};

barba.init({
  transitions: [{
    async leave(data) {
      const done = this.async();
      document.querySelector('.slide-out').style.opacity = 1;
      await new Promise((resolve) => {
        setTimeout(() => {
          resolve();
        }, 1000);
      });
      done();
    },
    enter(data) {
      document.querySelector('.slide-in').style.opacity = 0;
    },
  }],
});

export default transition;
